import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import HomeIcon from '@material-ui/icons/Home';
import FavoriteIcon from '@material-ui/icons/Favorite';
import VideocamIcon from '@material-ui/icons/Videocam';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Drawer from '@material-ui/core/Drawer';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

function App() {

  function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`tabpanel-${index}`}
        {...other}
      >
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  const [value, setValue] = React.useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const aSections = [
    {
      label: "Home Page",
      icon: <HomeIcon />
    },
    {
      label: "About Me",
      icon: <FavoriteIcon />
    },
    {
      label: "Stream Info",
      icon: <VideocamIcon />
    }
  ]
  const [open, setOpen] = React.useState(false);

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  return (
    <div className="App">
      <header className="page-header">
        <img src={"https://static-cdn.jtvnw.net/jtv_user_pictures/690c1f7a-dda3-424c-9520-9b12f4ce58b6-profile_image-70x70.png"} className="profile-icon" alt="Whoops..." />
        <p>
          KrunkyXO
        </p>
      </header>
      <AppBar className="tab-bar-wrapper">
        <Toolbar className="tab-bar">
          <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            // className={clsx(classes.menuButton, {
            //   [classes.hide]: open,
            // })}
          >
            <MenuIcon />
          </IconButton>
        </Toolbar>
        {/* <Tabs value={value} onChange={handleChange}  className="tab-bar">
          <Tab icon={<HomeIcon />} label="Home" id="tab-home" />
          <Tab icon={<FavoriteIcon />} label="About Me" id="tab-about" />
          <Tab icon={<VideocamIcon />} label="Stream Schedule" id="tab-schedule" />
        </Tabs> */}
      </AppBar>
      {/* <TabPanel value={value} index={0}>
        Home Page
      </TabPanel>
      <TabPanel value={value} index={1}>
        About Me tab...
      </TabPanel>
      <TabPanel value={value} index={2}>
        Stream schedule tab....
      </TabPanel> */}
      <Drawer
        variant="persistent"
        open={open}
        anchor="left"
        className={open ? "drawer-open" : "drawer-close"}
        // className={clsx(classes.drawer, {
        //   [classes.drawerOpen]: open,
        //   [classes.drawerClose]: !open,
        // })}
        // classes={{
        //   paper: clsx({
        //     [classes.drawerOpen]: open,
        //     [classes.drawerClose]: !open,
        //   }),
        // }}
      >
        <div >
          <IconButton onClick={handleDrawerClose}>
            {<ChevronLeftIcon />}
          </IconButton>
        </div>
        <Divider />
        <List>
          {aSections.map((item) => (
            <ListItem button key={item.label}>
              <ListItemIcon>{item.icon}</ListItemIcon>
              <ListItemText primary={item.label} />
            </ListItem>
          ))}
        </List>
      </Drawer>
      <div className="footer">
        <ul>
        <li><a className="link" href="https://www.twitch.tv/krunkyxo"target="_blank"rel="noopener noreferrer">Twitch</a></li>
          <li><a className="link" href="https://www.instagram.com/jaydead.xo/"target="_blank"rel="noopener noreferrer">Instagram</a></li>
          <li><a className="link" href="https://twitter.com/ludicol0"target="_blank"rel="noopener noreferrer">Twitter</a></li>
          <li><a className="link" href="https://www.facebook.com/jaydeadxo"target="_blank"rel="noopener noreferrer">Facebook</a></li>
        </ul>
      </div>

    </div>
  );
}

export default App;
